import React, { Component } from 'react'

class Loading extends Component{
    click = () => {
        const newState = !this.props.isActive
        this.props.onButtonClick({
          id: this.props.buttonText,
          isActive: newState})
    }

    render() {
        return (
            <div className="loading-container">
                <img src="loading.png"/>
            </div>
        )
    }
}

export default Loading
